import React from 'react'
import axios from 'axios'
import QuestList from './questList'
import { Link } from "react-router-dom";

import '../App.css';


export default function Dashboardqust() {
    
   
    const [data,setData] = React.useState([])
    React.useEffect(async() => {
        const res = await axios.get('http://localhost:3000/question/allQ')
        setData(res.data)
        return () => {
            // cleanup
        }
    }, [])

    return (
        <div>
           

            <table class="table">
                <tr>
                <th>question</th>
                <th>answer</th>
                <th>point</th>
                <th>false choices</th>
                </tr>
                {data.map((quest) => (
                        <QuestList data={quest} key={quest._id} />
                    ))}
               
                
            </table>   
            
        </div>
      
    );
  }
